import React, { Component } from "react";
import './Contact.css';

class Contact extends Component {
    render() {
        return (
            <div>
                <h1 className=" text-white text-center display-1 py-3" style={{fontFamily: "cinematic"}}> For Contact</h1>
                <div className="container-fluid card">
                
                <div className="row">
                    <div className="col-md-6">
                        <img
                            src="https://i.pinimg.com/564x/2e/7b/d6/2e7bd673aaf90ab9eda41ecc19477532.jpg"
                            width="300px"
                            height="200px"
                            alt="Contact"
                        />
                    </div>
                    <div className="col-md-6">
                        {/* Content for the second column goes here */}
                    </div>
                </div>
            </div>
            </div>
         
        );
    }
}

export default Contact;
